import React from "react";
import ReactDOM from "react-dom/client";
import App from "./App";
import "./index.css";

// Filtrar errores de extensiones (MetaMask) solo en desarrollo
if (import.meta ? import.meta.env?.MODE === 'development' : process.env.NODE_ENV === 'development') {
  window.addEventListener('error', (e) => {
    const fromExtension = String(e?.filename || '').startsWith('chrome-extension://');
    const isMetamask = /metamask/i.test(String(e?.message || ''));
    if (fromExtension || isMetamask) {
      e.preventDefault();
    }
  });
  window.addEventListener('unhandledrejection', (e) => {
    const msg = String(e?.reason?.message || e?.reason || '');
    if (/metamask/i.test(msg)) {
      e.preventDefault();
    }
  });
}

const root = ReactDOM.createRoot(document.getElementById("root")!);
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
